(64, 'Solesmes', 'Benedic anima (Ps.103 - Textus antiquus)', 0, 'ps', NULL, NULL, 'Andrew Hinkley', '', '"(f3) 1. B\\u00e9(e)ne(f)dic,(h) \\u00e1(h)ni(h)ma(h) me(h)a,(h) <b>D\\u00f3</b>(i)mi(hr)no:(h.) *(:) D\\u00f3(h)mi(h)ne(h) De(h)us(h) me(h)us,(h) ma(h)gni(h)fi(h)c\\u00e1(h)tus(h) es(h) ve(h)<i>he</i>(g)<b>m\\u00e9n</b>(e fr)ter.(f.) (::) <i>Flexa:</i> d{u}x(h) est(h) e(h)\\u00f3(h fr)rum:(h.) +() (h) (h) (h)\\n"', NULL, '2. Confessiónem et decórem indu{\\bf í}sti: * amíctus lúmine sicut ves{\\it ti}{\\bf mén}to:\\\\\n\\\\\n3. Exténdens caelum sicut {\\bf pel}lem: * qui tegis aquis superió{\\it ra} {\\bf e}jus.\\\\\n\\\\\n4. Qui ponis nubem ascénsum {\\bf tu}um: * qui ámbulas super pennas {\\it ven}{\\bf tó}rum.\\\\\n\\\\\n5. Qui facis ángelos tuos {\\bf spí}ritus: * et minístros tuos ignem {\\it u}{\\bf rén}tem.\\\\\n\\\\\n6. Qui fundásti terram super stabilitátem {\\bf su}am: * non inclinábitur in saécu{\\it lum} {\\bf saé}culi.\\\\\n\\\\\n7. Abýssus sicut vestiméntum amíctus {\\bf e}jus: * super montes sta{\\it bunt} {\\bf a}quae.\\\\\n\\\\\n8. Ab increpatione tua {\\bf fú}gient: * a voce tonítrui tui for{\\it mi}{\\bf dá}bunt.\\\\\n\\\\\n9. Ascéndunt montes, et descéndunt {\\bf cam}pi * in locum quem fundá{\\it sti} {\\bf e}is.\\\\\n\\\\\n10. Términum posuísti quem non transgredi{\\bf én}tur: * neque converténtur operi{\\it re} {\\bf ter}ram.\\\\\n\\\\\n11. Qui emíttis fontes in con{\\bf vál}libus: * inter médium móntium pertransí{\\it bunt} {\\bf a}quae.\\\\\n\\\\\n12. Potábunt omnes béstiae {\\bf a}gri: * expectábunt ónagri in si{\\it ti} {\\bf su}a.\\\\\n\\\\\n13. Super ea vólucres caeli habi{\\bf tá}bunt: * de médio petrárum da{\\it bunt} {\\bf vo}ces.\\\\\n\\\\\n14. Rigans montes de superióribus {\\bf su}is: * de fructu óperum tuórum satiábi{\\it tur} {\\bf ter}ra:\\\\\n\\\\\n15. Prodúcens fenum ju{\\bf mén}tis, * et herbam servitú{\\it ti} {\\bf hó}minum:\\\\\n\\\\\n16. Ut edúcas panem de {\\bf ter}ra: * et vinum laetíficet {\\it cor} {\\bf hó}minis:\\\\\n\\\\\n17. Ut exhílaret fáciem in {\\bf ó}leo: * et panis cor hóminis {\\it con}{\\bf fír}met,\\\\\n\\\\\n18. Saturabúntur ligna campi, et cedri Líbani quas plan{\\bf tá}vit, * illic pásseres nidi{\\it fi}{\\bf cá}bunt.\\\\\n\\\\\n19. Heródii domus dux est eórum: $\\dag$ montes excélsi {\\bf cer}vis: * petra refúgium he{\\it ri}{\\bf ná}ciis.\\\\\n\\\\\n20. Fecit lunam in {\\bf tém}pora: * sol cognóvit occá{\\it sum} {\\bf su}um.\\\\\n\\\\\n21. Posuísti tenébras, et facta {\\bf est} nox: * in ipsa pertransíbunt omnes bésti{\\it ae} {\\bf sil}vae.\\\\\n\\\\\n22. Cátuli leónum rugiéntes ut {\\bf rá}piant, * et quaerant a Deo e{\\it scam} {\\bf si}bi.\\\\\n\\\\\n23. Ortus est sol, et congre{\\bf gá}ti sunt: * et in cubílibus suis collo{\\it ca}{\\bf bún}tur.\\\\\n\\\\\n24. Exíbit homo ad opus {\\bf su}um: * et ad operatiónem suam usque {\\it ad} {\\bf vé}sperum.\\\\\n\\\\\n25. Quam magnificáta sunt ópera tua, Dómine! $\\dag$ ómnia in sapiéntia fe{\\bf cí}sti: * impléta est terra possessió{\\it ne} {\\bf tu}a.\\\\\n\\\\\n26. Hoc mare magnum et spatiósum {\\bf má}nibus: * illic reptília quorum non {\\it est} {\\bf nú}merus.\\\\\n\\\\\n27. Animália pusílla cum {\\bf ma}gnis: * illic naves per{\\it trans}{\\bf í}bunt.\\\\\n\\\\\n28. Draco iste quem formásti ad illudéndum {\\bf e}i: * ómnia a te exspéctant ut des illis escam {\\it in} {\\bf tém}pore.\\\\\n\\\\\n29. Dante te illis, {\\bf cól}ligent: * aperiénte te manum tuam, ómnia implebúntur bo{\\it ni}{\\bf tá}te.\\\\\n\\\\\n30. Averténte autem te fáciem, turbabúntur: $\\dag$ áuferes spíritum eórum, et de{\\bf fí}cient, * et in púlverem suum re{\\it ver}{\\bf tén}tur.\\\\\n\\\\\n31. Emíttes spíritum tuum, et crea{\\bf bún}tur: * et renovábis fáci{\\it em} {\\bf ter}rae.\\\\\n\\\\\n32. Sit glória Dómini in {\\bf saé}culum: * laetábitur Dóminus in opéri{\\it bus} {\\bf su}is:\\\\\n\\\\\n33. Qui réspicit terram, et facit eam {\\bf tré}mere: * qui tangit móntes, {\\it et} {\\bf fú}migant.\\\\\n\\\\\n34. Cantábo Dómino in vita {\\bf me}a: * psállam Deo meo quám{\\it di}{\\bf u} sum.\\\\\n\\\\\n35. Jucúndum sit ei elóquium {\\bf me}um: * ego vero delectábor {\\it in} {\\bf Dó}mino.\\\\\n\\\\\n36. Defíciant peccatóres a terra, et iníqui, ita ut {\\bf non} sint: * bénedic, ánima me{\\it a}, {\\bf Dó}mino.', NULL),
