(273, 'Solesmes', 'Lauda, Jerusalem (Ps.147 - Textus antiquus)', 1, 'ps', NULL, NULL, 'Andrew Hinkley', '', '"(c4) Lau(g)da,(h) Je(j)r\\u00fa(j)sa(j)lem,(j) <b>D\\u00f3</b>(k)mi(jr)num :(j.) (:) * lau(j)da(j) D\\u00e9(j)um(j) <i>tu</i>(i)<i>um,</i>(j) <b>Si</b>(h gr)on.(g.) (::)2. Qu\\u00f3(j)ni(j)am....(j)"', NULL, '2. Quóniam confortávit seras portárum tu{\\bf á}rum : * benedíxit fíliis {\\it tuis} {\\bf in} te.\\\\\n\\\\\n3. Qui pósuit fines tuos {\\bf pa}cem : * et ádipe fruménti {\\it sáti}{\\bf at} te.\\\\\n\\\\\n4. Qui emíttit elóquium suum {\\bf ter}rae : * velóciter currit {\\it sermo} {\\bf e}jus.\\\\\n\\\\\n5. Qui dat nivem sicut {\\bf la}nam : * nébulam sicut cí{\\it nerem} {\\bf spar}git.\\\\\n\\\\\n6. Mittit crystállum suam sicut buc{\\bf cél}las : * ante fáciem frígoris ejus quis {\\it susti}{\\bf né}bit?\\\\\n\\\\\n7. Emíttet verbum suum, et liquefáciet {\\bf e}a : * flabit spíritus ejus, et {\\it fluent} {\\bf a}quae.\\\\\n\\\\\n8. Qui annúntiat verbum suum {\\bf Ja}cob : * justítias et judícia {\\it sua} {\\bf Is}rael.\\\\\n\\\\\n9. Non fecit táliter omni nati{\\bf ó}ni : * et judícia sua non manife{\\it stávit} {\\bf e}is.\\\\\n\\\\\n10. Glória {\\bf Pa}tri, et {\\bf Fí}lio, * et Spirí{\\it tui} {\\bf San}cto.\\\\\n\\\\\n11. Sicut erat in princípio, et {\\bf nunc,} et {\\bf sem}per, * et in saécula saecu{\\it lórum.} {\\bf A}men.', NULL),
