(288, 'Solesmes', 'Domini est terra (Ps.23 - Textus antiquus)', 1, 'ps', NULL, NULL, 'Andrew Hinkley', '', '"(c4) Do(f)mi(gh)ni(h) est(h) ter(h)ra,(h) et(h) ple(h)ni(h)t\\u00fa(ixi hr)do(h) e(g hr)jus(h) :(:) * or(h)bis(h) ter(h)r\\u00e1(h)rum,(h) et(h) u(h)ni(h)v\\u00e9r(h)si(h) qui(h) h\\u00e1(h)bi(h)tant(g) in(f) e(gh gr)o.(gf..) (::) (Z) <i>Flexa :</i> pr{\\u00ed}n(h)ci(h)pes(h) ves(h gr)tras,(g.) +(h) (h) (h) (::) 2. Qui(h)a(h)...()"', NULL, '2. Quia ipse super mária fun{\\bf dá}vit {\\bf é}um, * et super flúmina praepa{\\it rávit} {\\bf e}um.\\\\\n\\\\\n\\vspace{3pt}\\red{Et repetitur antiphona} Púeri, \\red{ ut supra.}\\vspace{3pt}\\\\\n\\\\\n7. Attóllite portas, príncipes, vestras, $\\dag$ et elevámini, portae {\\bf ae}ter{\\bf ná}les, * et introí{\\it bit rex} {\\bf gló}riae.\\\\\n\\\\\n8. Quis est iste rex glóriae ? $\\dag$ Dóminus {\\bf for}tis et {\\bf po}tens, * Dóminus po{\\it tens in} {\\bf praé}lio.\\\\\n\\\\\n\\vspace{3pt}\\red{Et repetitur antiphona} Púeri, \\red{ ut supra.}\\vspace{3pt}\\\\\n\\\\\n9. Attóllite portas, príncipes, vestras, $\\dag$ et elevámini, portae {\\bf ae}ter{\\bf ná}les, * et introí{\\it bit rex} {\\bf gló}riae.\\\\\n\\\\\n10. Quis est {\\bf is}te rex {\\bf gló}riae ? * Dóminus virtútum ipse {\\it est rex} {\\bf gló}riae.\\\\\n\\\\\n\\vspace{3pt}\\red{Et repetitur antiphona} Púeri, \\red{ ut supra.}\\vspace{3pt}\\\\\n\\\\\n11. Glória {\\bf Pa}tri, et {\\bf Fí}lio, * et Spirí{\\it tui} {\\bf San}cto.\\\\\n\\\\\n12. Sicut erat in princípio, et {\\bf nunc,} et {\\bf sem}per, * et in saécula saecu{\\it lórum.} {\\bf A}men.\\\\\n\\\\\n\\vspace{3pt}\\red{Et repetitur antiphona} Púeri, \\red{ ut supra.}\\vspace{3pt}', NULL),
