(355, 'Solesmes', 'Dominus regit me (Ps.22 - Textus antiquus)', 0, 'ps', NULL, NULL, 'Andrew Hinkley', '', '"(f3) 1. D\\u00f3(e)mi(f)nus(h) re(h)git(h) me,(h) et(h) ni(h)hil(h) mi(h)hi(h) d\\u00e9(i)e(hr)rit:(h.) *(:) in(h) lo(h)co(h) p\\u00e1(h)scu(h)e(h) i(h)bi(h) me(h) col(h)lo(g)c\\u00e1(e fr)vit.(f.) (::) 2. Su(h)per(h)...()\\n"', NULL, '2. Super aquam refectiónis edu{\\bf cá}vit me : * ánimam meam {\\it con}{\\bf vér}tit.\\\\\n\\\\\n3. Dedúxit me super sémitas jus{\\bf tí}tiae : * propter no{\\it men} {\\bf su}um.\\\\\n\\\\\n4. Nam et si ambulávero in médio umbrae mortis, non timébo {\\bf ma}la : * quóniam {\\it tu} {\\bf me}cum es.\\\\\n\\\\\n5. Virga tua, et báculus {\\bf tu}us : * ipsa me con{\\it so}{\\bf lá}ta sunt.\\\\\n\\\\\n6. Parásti in conspéctu meo {\\bf men}sam : * advérsus eos qui trí{\\it bu}{\\bf lant} me.\\\\\n\\\\\n7. Impinguásti in óleo caput {\\bf me}um : * et calix meus inébrians quam {\\it prae}{\\bf clá}rus est!\\\\\n\\\\\n8. Et misericordia tua subse{\\bf qué}tur me, * ómnibus diébus vi{\\it tae} {\\bf me}ae.\\\\\n\\\\\n9. Et ut inhábitem in domo {\\bf Dó}mini, * in longitúdinem {\\it di}{\\bf é}rum.', NULL),
