(447, 'Solesmes', 'Deus, Deus meus (Ps.21 - Textus antiquus)', 0, 'ps', NULL, NULL, 'Andrew Hinkley', '', '"(f3) 1. De(h)us,(h) De(h)us(h) me(h)us,(h) r\\u00e9(h)spi(h)ce(h) in(h fr) me :(f.) +(,) qua(h)re(h) me(h) de(h)<i>re</i>([alt:2]g)<i>li</i>([alt:1]f)<b>qu\\u00ed</b>(hr1. hr)sti?(h.) *(:) lon(h)ge(h) a(h) sa(h)l\\u00fa(h)te(h) me(h)a(h) ver(h)ba(h) de(h)li(h)ct\\u00f3(h)rum(h) me(h)<b>\\u00f3</b>(hr1 fr)rum.(f.) (::) <i>Flexa :</i> {e}x(h) \\u00fa(h)te(fr)ro(f.) :() +(h) (h) (h)"', NULL, '2. Deus meus, clamábo per diem, et {\\it non ex}{\\bf áu}dies: * et nocte, et non ad insipiéntiam {\\bf mi}hi.\\\\\n\\\\\n3. Tu autem in {\\it sancto} {\\bf há}bitas, * laus {\\bf Is}ra\\"{e}l.\\\\\n\\\\\n4. In te speravérunt {\\it patres} {\\bf no}stri: * speravérunt, et liberásti {\\bf e}os.\\\\\n\\\\\n5. Ad te clamavérunt, et {\\it salvi} {\\bf fa}cti sunt: * in te speravérunt, et non sunt con{\\bf fú}si.\\\\\n\\\\\n6. Ego autem sum vermis, {\\it et non} {\\bf ho}mo: * oppróbrium hóminum, et abjéctio {\\bf ple}bis.\\\\\n\\\\\n7. Omnes vidéntes me {\\it deri}{\\bf sé}runt me: * locúti sunt lábiis, et movérunt {\\bf ca}put.\\\\\n\\\\\n8. Sperávit in Dómino, erí{\\it piat} {\\bf e}um: * salvum fáciat eum, quóniam vult {\\bf e}um.\\\\\n\\\\\n9. Quóniam tu es, qui extraxísti {\\it me de} {\\bf ven}tre: * spes mea ab ubéribus matris {\\bf me}ae.\\\\\n\\\\\n10. In te projéctus sum ex útero: $\\dag$ De ventre matris meae Deus {\\it meus} {\\bf es} tu, * ne discésseris {\\bf a} me :\\\\\n\\\\\n11. Quóniam tribulátio {\\it próxi}{\\bf ma} est: * quóniam non est qui {\\bf ád}juvet.\\\\\n\\\\\n12. Circumdedérunt me ví{\\it tuli} {\\bf mul}ti: * tauri pingues obse{\\bf dé}runt me.\\\\\n\\\\\n13. Aperuérunt super {\\it me os} {\\bf su}um, * sicut leo rápiens et {\\bf rú}giens.\\\\\n\\\\\n14. Sicut a{\\it qua ef}{\\bf fú}sus sum: * et dispérsa sunt ómnia ossa {\\bf me}a.\\\\\n\\\\\n15. Factum est cor meum tamquam ce{\\it ra li}{\\bf qué}scens * in médio ventris {\\bf me}i.\\\\\n\\\\\n16. Aruit tamquam testa virtus mea, $\\dag$ et lingua mea adhaesit fáu{\\it cibus} {\\bf me}is: * et in púlverem mortis dedu{\\bf xí}sti me.\\\\\n\\\\\n17. Quóniam circumdedérunt me {\\it canes} {\\bf mul}ti: * concílium malignántium ob{\\bf sé}dit me.\\\\\n\\\\\n18. Fodérunt manus meas et {\\it pedes} {\\bf me}os: * dinumeravérunt ómnia ossa {\\bf me}a.\\\\\n\\\\\n19. Ipsi vero consíderavérunt et inspexérunt me: $\\dag$ divisérunt sibi vesti{\\it ménta} {\\bf me}a, * et super vestem meam misérunt {\\bf sor}tem.\\\\\n\\\\\n20. Tu autem, Dómine, ne elongáveris auxílium {\\it tuum} {\\bf a} me: * ad defensiónem meam {\\bf cón}spice.\\\\\n\\\\\n21. Erue a frámea, Deus, á{\\it nimam} {\\bf me}am: * et de manu canis únicam {\\bf me}am.\\\\\n\\\\\n22. Salva me ex o{\\it re le}{\\bf ó}nis: * et a córnibus unicórnium humilitátem {\\bf me}am.\\\\\n\\\\\n23. Narrábo nomen tuum frá{\\it tribus} {\\bf me}is: * in médio Ecclésiae lau{\\bf dá}bo te.\\\\\n\\\\\n24. Qui timétis Dóminum, lau{\\it dáte} {\\bf e}um: * univérsum semen Jacob, glorificáte {\\bf e}um.\\\\\n\\\\\n25. Tímeat eum omne {\\it semen} {\\bf Is}ra\\"{e}l: * quóniam non sprevit, neque despéxit deprecatiónem {\\bf páu}peris.\\\\\n\\\\\n26. Nec avértit fáciem {\\it suam} {\\bf a} me: * et cum clamárem ad eum, exau{\\bf dí}vit me.\\\\\n\\\\\n27. Apud te laus mea in ecclé{\\it sia} {\\bf ma}gna: * vota mea reddam in conspéctu timéntium {\\bf e}um.\\\\\n\\\\\n28. Edent páuperes, et saturabúntur: $\\dag$ et laudábunt Dóminum qui re{\\it quírunt} {\\bf e}um: * vivent corda eórum in saéculum {\\bf saé}culi.\\\\\n\\\\\n29. Reminiscéntur et convertén{\\it tur ad} {\\bf Dó}minum * univérsi fines {\\bf ter}rae.\\\\\n\\\\\n30. Et adorábunt in con{\\it spéctu} {\\bf e}jus * univérsae famíliae {\\bf gén}tium.\\\\\n\\\\\n31. Quóniam Dómi{\\it ni est} {\\bf re}gnum: * et ipse dominábitur {\\bf gén}tium.\\\\\n\\\\\n32. Manducavérunt et adoravérunt omnes {\\it pingues} {\\bf ter}rae : * in conspéctu ejus cadent omnes qui descéndunt in {\\bf ter}ram.\\\\\n\\\\\n33. Et ánima mea {\\it illi} {\\bf vi}vet: * et semen meum sérviet {\\bf i}psi.\\\\\n\\\\\n34. Annuntiábitur Dómino generátio ventúra: $\\dag$ et annuntiábunt caeli justítiam ejus pópulo {\\it qui na}{\\bf scé}tur, * quem fecit {\\bf Dó}minus.', NULL),
