\\\\n\\\\\n3.&Tu nátum Dóminum stríngis, ad éxteras\\\\\n&Aegýpti prófugum tu séqueris plágas:\\\\\n&Amíssum Sólymis quaéris et ínvenis,\\\\\n&Míscens gáudia flétibus.\\\\\n\\\\\n4.&Post mórtem réliquos sors pía cónsecrat,\\\\\n&Palmámqu{\\it e} eméritos glória súscipit:\\\\\n&Tu vívens, Súperis par, frúeris Déo,\\\\\n&Míra sórte beátior.\\\\\n\\\\\n5.&Nóbis, súmma Trías, párce precántibus:\\\\\n&Da Jóseph méritis sídera scándere\\\\\n&Ut tándem líceat nos tíbi pérpetim\\\\\n&Grátum prómere cánticum. Amen.\n\\end{tabular}', NULL),
