dh''!iv)NIS(h) AN(hg)GÉ(h!iwj)LI(ivHG)CUS(h.) (,) fit(h) pá(f'')nis(g) hó(g'')mi(f)num:(e.) (;) Dat(f'') pá(g)nis(f!gh) c<sp>''æ</sp>(f'')li(e)cus(d.) (,) fi(f)gú(d'')ris(c) tér(ef)mi(d)num:(d.) (:) O(h'') res(i) mi(ji)rá(g'')bi(h)lis!(g.) (,) man(ih)dú(i)cat(ji) Dó(h'')mi(g)num(h.) (;) Páu(ix//dh''!iv)per,(h'') sér(g)vus,(fvED'') et(e) hú(fg)mi(f)lis.(e.) (::) \n7.() Te(dh''!iv) tri(h)na(hg) Dé(h!iwj)i(ivHG)tas(h.) (,) ú(h)na(f'')que(g) po(g'')scí(f)mus,(e.) (;) Sic(f'') nos(g) tu(f!gh) ví(f'')si(e)ta,(d.) (,) si(f)cut(d'') te(c) có(ef)li(d)mus:(d.) (:) Per(h'') tu(i)as(ji) sé(g'')mi(h)tas(g.) (,) duc(ih) nos(i) quo(ji) tén(h'')di(g)mus,(h.) (;) Ad(ix//dh''!iv) lu(h'')cem(g) quam(fvED'') in(e)há(fg)bi(f)tas.(e.) (::) A(efe)men.(de..) (::)', 'Noctis recólitur coena novíssima,\\\\\nQua Christus créditur agnum et ázyma\\\\\nDedísse frátribus, juxta legítima\\\\\nPriscis indúlta pátribus.\\\\\n\\\\\nPost agnum týpicum, explétis épulis,\\\\\nCorpus Domínicum datum discípulis,\\\\\nSic totum ómnibus, quod totum síngulis,\\\\\nEjus fatémur mánibus.\\\\\n\\\\\nDedit fragílibus córporis férculum,\\\\\nDedit et trístibus sánguinis póculum,\\\\\nDicens: Accípite quod trado vásculum,\\\\\nOmnes ex eo bíbite.\\\\\n\\\\\nSic sacrifícium istud instítuit,\\\\\nCujus offícium commítti vóluit\\\\\nSolis presbýteris, quibus sic cóngruit,\\\\\nUt sumant, et dent céteris.\\\\\n\\\\\nPanis angélicus fit panis hóminum;\\\\\nDat panis caélicus figúris términum:\\\\\nO res mirábilis! mandúcat Dóminum\\\\\nPauper, servus, et húmilis.\\\\\n\\\\\nTe trina Déitas únaque póscimus,\\\\\nSic nos tu vísita, sicut te cólimus:\\\\\nPer tuas sémitas duc nos quo téndimus,\\\\\nAd lucem quam inhábitas. Amen.', NULL),
