 Paráclitus,&5.&Hóstem repéllas lóngius,\\\\\n&Altíssimi dónum Déi,&&Pacémque dónes prótinus:\\\\\n&Fons vívus, ignis, cáritas,&&Ductóre sic te praévio,\\\\\n&Et spiritális únctio.&&Vitémus ómne nóxium.\\\\\n\\\\\n3.&Tu septifórmis múngere,&6.&Per te sciámus da Pátrem,\\\\\n&Díg{\\it i}tus patérnae déxterae,&&Noscámus atque Fílium,\\\\\n&Tu rite promíssum Pátris,&&Téqu{\\it e} utriúsque Spíritum\\\\\n&Sermóne dítans gúttura.&&Credámus ómni témpore.\\\\\n\\\\\n4.&Accénde lúmen sénsibus,&7.&Déo Pátri sit glória,\\\\\n&Infúnd{\\it e} amórem córdibus,&&Et Fílio, qu{\\it i} a mórtuis\\\\\n&Infírma nóstri córporis&&Surréxit, ac Paráclito,\\\\\n&Virtúte fírmans pérpeti.&&In saeculórum saécula. Amen.\n\\end{tabular}\n\\par\n\\Vbar . Repléti sunt ómnes Spíritu Sáncto, allelúia.\n\\setlength\\parskip{0in}\n\\par\n\\Rbar . Et coepérunt lóqui, allelúia.', NULL),
