(2992, 'Vatican', 'Vexilla Regis (Graduale)', 1, 'hy', NULL, NULL, NULL, NULL, '"(c4)VE(f)XIL(gh)LA(ixi) Re(hvGF)gis(g) pr\\u00f3(ghg)de(f)unt:(ed) (;) Ful(g)get(g) Cru(h)cis(fd) mys(f)t\\u00e9(ef)ri(d)um,(cd) (:) Quo(d) car(d)ne(f) car(dc)nis(f) C\\u00f3n(f!gh)di(g)tor(gf) (;) Sus(f)p\\u00e9n(fixhiHG)sus(h) est(fd) pa(f)t\\u00ed(ef)bu(d)lo.(cd) (::) "', NULL, '2. Quo vulnerátus ínsuper\\\\\nMucróne diro lánceae,\\\\\nUt nos laváret crímine,\\\\\nManávit unda et sánguine.\\\\\n\n3. Impléta sunt quae cóncinit\\\\\nDavid fidéli cármine,\\\\\nDicéns: In natiónibus:\\\\\nRegnávit a ligno Deus.\\\\\n\n4. Arbor decóra et fúlgida,\\\\\nOrnáta Regis púrpura,\\\\\nElécta digno stípite\\\\\nTam sancta membra tángere.\\\\\n\n5. Beáta, cujus bráchiis\\\\\nSaecli pepéndit prétium:\\\\\nStatéra facta córporis,\\\\\nPraedámque tulit tártari.\\\\\n\n6. O Crux ave, spes única,\\\\\nHoc Passiónis témpore:\\\\\nAuge piis justítiam,\\\\\nReísque dona véniam.\\\\\n\n7. Te summa Deus Trínitas,\\\\\nColláudet omnis spíritus:\\\\\nQuos per Crucis mystérium\\\\\nSalvas, rege per saécula.\\\\\nAmen.', NULL),
