li gáudio, allelúia:\\\\\r\n&Benedicámus Dómino, allelúia, allelúia. \\Rbar . In córdis.\\\\\r\n\\\\\r\n14. &Laudétur sáncta Trínitas, allelúia,\\\\\r\n&Déo dicámus grátias, allelúia, allelúia. \\Rbar . In córdis.\r\n\\end{tabular}', NULL),
