(3293, 'Vatican', 'Vexilla Regis (Antiphonale)', 1, 'hy', '1', NULL, NULL, NULL, '"(c4)VE(f)XIL(gh)LA(ixi) Re(hvGF)gis(g) pr\\u00f3(ghg)de(f)unt:(ed) (;) Ful(g)get(g) Cru(h)cis(fd) mys(f)t\\u00e9(ef)ri(d)um,(cd) (:) Quo(d) car(d)ne(f) car(dc)nis(f) C\\u00f3n(f!gh)di(g)tor(gf) (;) Sus(f)p\\u00e9n(fixhiHG)sus(h) est(fd) pa(f)t\\u00ed(ef)bu(d)lo.(cd) (::)"', NULL, '2. Quae vulneráta lánceae\\\\\nMucróne diro, críminum\\\\\nUt nos laváret sórdibus,\\\\\nManávit unda et sánguine.\\\\\n\n3. Impléta sunt quae cóncinit\\\\\nDavid fidéli cármine,\\\\\nDicéndo natiónibus:\\\\\nRegnávit a ligno Deus.\\\\\n\n4. Arbor decóra et fúlgida,\\\\\nOrnáta Regis púrpura,\\\\\nElécta digno stípite\\\\\nTam sancta membra tángere.\\\\\n\n5. Beáta, cujus bráchiis\\\\\nPrétium pepéndit saéculi:\\\\\nStatéra facta córporis,\\\\\nTulítque praedam tártari.\\\\\n\n6. O Crux ave, spes única,\\\\\nHoc Passiónis témpore:\\\\\nPiis adáuge grátiam,\\\\\nReísque dele crímina.\\\\\n\n7. Te, fons salútis Trínitas,\\\\\nColláudet omnis spíritus:\\\\\nQuibus Crucis victóriam\\\\\nLargíris, adde praémium.\\\\\nAmen.', NULL),
