(4487, 'Solesmes', 'Dominus vobiscum (Toni Orationem: Tonus festivus.)', 1, 'or', NULL, NULL, NULL, NULL, '"(c3)DO(h)mi(h)nus(h) vo(h)b\\u00eds(h)cum.(h.) (::) <sp>R/</sp>. Et(h) cum(h) sp\\u00ed(h)ri(h)tu(h) tu(h)o.(h.) (::)"', NULL, NULL, 'Hic tonus servatur in dominicis, in Missis festivis et in Missa de Officio S. Mariae in sabbato, in vigiliis I. classis, feria V in Cena Domini et in Missa Vigiliae paschalis, per octavas, in Missis votivis I., II. et III. classis.'),
(4488, 'Solesmes', 'Dominus vobiscum (Toni Orationem: Toni antiqui ad libitum: Tonus solemnis.)', 1, 'or', NULL, NULL, NULL, NULL, '"(c4)DO(g)mi(h)nus(h) vo(gh)b\\u00eds(hg)cum.(g.) (::) <v>[</v>Pax(gh) vo(hg)bis<v>]</v>.(g.) (::) <sp>R/</sp>. Et(g) cum(h) sp\\u00ed(h)ri(g)tu(g) tu(h)o.(h.) (::)"', NULL, NULL, 'Hic Tonus adhibetur pro omnibus Orationibus Missae (praeter Orationem Super pópulum), sine distinctione ritus festivi vel ferialis, et in Missis Defunctorum; insuper pro omnibus Orationibus quibus praevia est monitio Flectámus génua, in quibuslibet Functionibus.\n\nAll the Prayers of the Mass (except the Prayer Super populum) may be sung in this tone without distinction as to festal or ferial rite.'),
(4489, 'Solesmes', 'Dominus vobiscum (Toni Orationem: Toni antiqui ad libitum: Tonus simplex.)', 1, 'or', NULL, NULL, NULL, NULL, '"(c3)DO(h)mi(h)nus(h) vo(h)b\\u00eds(h)cum.(f.) (::) <sp>R/</sp>. Et(h) cum(h) sp\\u00ed(h)ri(h)tu(h) tu(h)o.(f.) (::)"', NULL, NULL, 'NOTE: SORRY, THIS SCORE IS INCOMPLETE. THERE IS STILL A LONG OREMUS SECTION TO BE ENTERED.\r\n\r\nHic Tonus inservit pro Orationibus ad Aspersionem, Benedictiones et Litantas, et pro ceteris Orationibus hujusmodi (praeter illas quas praecedit monítio Flectámus génua).\r\n\r\nThis tone is used for the Prayers of the Aspersion, of the Blessings, of the Litanies, and for other Prayers of the same kind, except those which are preceded by Flectamus genua.\r\nIf this simple tone be adopted, it is used also for the Prayer Super populum. after the admonition Humiliáte cápita véstra. (as on p. 99).'),
